import React from 'react';

function Save_page({ savedBlogs }) {
  return (
    <div>
      <div className="news-header">
        <img src="/img/logo.jpeg" alt="Logo" />
        <h1>Закладки</h1>
      </div>
      <div className="content">
        {savedBlogs.map(blog => (
          <Blog_main key={blog.id} blog={blog} />
        ))}
      </div>
    </div>
  );
}

export default Save_page;
